import React from 'react';
import './App.css';
import HomePage from './components/HomePage';  // Import HomePage here
import CustomerOrders from './components/CustomerOrders';
import AdminOrderTable from './components/AdminOrderTable';
import OrderDetails from './components/pages/orderDetails';  // Adjust path to OrderDetails
import customerOrder from './components/pages/customerOrder';

import { createBrowserRouter, RouterProvider } from "react-router-dom";

const router = createBrowserRouter([
  { path: "/*", element: <HomePage /> },
  { path: "/customerorder", element: <CustomerOrders /> },
  { path: "/co", element: <customerOrder /> },  
  { path: "/od", element: <OrderDetails /> },  // Route to OrderDetails
  { path: "/adminorder", element: <AdminOrderTable /> },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
